from PIL import Imageimg = Image.open("data/sof.jpg")img.save("data/output.png")from PIL import ImageFilterblurred = img.filter(ImageFilter.BLUR)blurred.save("data/blurred.jpg")resized = img.resize((200, 200))resized.save("data/resized.jpg")gray = img.convert("L")gray.save("data/gray.jpg")cropped = img.crop((50, 50, 200, 200))cropped.save("data/cropped.jpg")rotated = img.rotate(45)rotated.save("data/rotated.jpg")exif_data = img.getexif()print(exif_data)if exif_data:    for tag, value in exif_data.items():        print(f'{tag}: {value}')